    def rnn_forward(self, x, h=None):
        print(self.W_ih_l0.shape)
        print(self.W_hh_l0.shape)
        print(self.b_ih_l0.shape)
        print(self.b_hh_l0.shape)
        print(self.fc_W.shape)
