        h = np.tanh(np.dot(self.W_ih_l0, x)[:, None] + self.b_ih_l0 + np.dot(self.W_hh_l0, h)[:, None] + self.b_hh_l0)
        print('h', h.shape)
        out = np.dot(self.fc_W, h) + self.fc_b
        return out, h
    
